import React, { useState, useEffect } from 'react';
import FoodCards from '../components/FoodCards';
import Navbar2 from '../components/Navbar2';
import { useGoogleAuth } from '../components/GoogleAuthProvider';
import { Link } from 'react-router-dom';
//import Eggs from '../imgs/eggs.jpeg';

function ProfilePage() {

    const { googleUser } = useGoogleAuth();
    const tokenID = googleUser.tokenId;
    const [recipes, setRecipeInfo] = useState([]);
    const [count, setCount] = useState(0);
    const [listCards, setListCards] = useState(<div></div>);


    const userInformation = 'I love to cook and have a whole series on youtube, so click on the link below to follow me!!!';
    const num = count;
    const yearJoined = '2021'

    // const ing = "blah blah blah blah blah blah blah blah blah blah blah blah blah blah blah blah ...";
    // const steps = "blah blah blah blah blah blah blah blah blah blah blah blah blah blah blah ...";



    useEffect(() => {
        const fetchData = async () => {
            const result = await fetch(`/api/userID/${tokenID}`);
            const body = await result.json();
            setRecipeInfo(body);
            setCount(body.length);
        }
        fetchData();
    }, []);

    useEffect(() => {
        let cards;
        if (recipes.length < 1) {
            cards = <p>No Results</p>;
        } else {
            cards = recipes.map((recipe) =>
                <FoodCards key={recipe._id} id={recipe._id} foodName={recipe.name} estimatedPrice={recipe.estimatedPrice}  ingredients={recipe.ingredients} steps={recipe.steps}/>
            );
        }
        setListCards(cards);


    }, [recipes]);

    return (
        <div id="profile-page">
            <Navbar2 willContainSearchBar={true}/>
            <div id="profile-info">
                <div id="div-container1">
                    <h1>{googleUser.profileObj.name}</h1>
                    <div id="setting-icon" className="icon-hover"></div>
                </div>
                <p>{userInformation}</p>
                <a href="https://youtube.com"> Visit Website </a>
            </div>
            <div id="profile-contributed-cards">
                <div id="div-container2">
                    <p>Contributed {num} recipes since {yearJoined}</p>
                    <Link id="add-icon" className="icon-hover" to="/Recipe-Creation"> </Link> 
                </div>
                <div id="food-cards-container">
                    {listCards}
                </div>
            </div>
        </div>
    )
}

export default ProfilePage;
